import React, { useContext } from 'react'
import { AuthContext } from '../AuthContex'

function User() {
  const auth=useContext(AuthContext);
  const handleOut=()=>{auth.logout()}
  return (
    <div>
        <button onClick={handleOut}>LOGOUT</button>
        <p>welcome {}</p>
    </div>
  )
}

export default User
